import axios from 'axios';
const Page =()=>{

const [users,setUsers]= useState([]);

useEffect(()=>{
const getUsers = async()=>{
  const res = await axios.get('/users');
  await axios.post('/register',{username:'testUser',password:'123',is_pro_user:false,first_name:'first',last_name:'last'});
  setUsers(res.data.map(u=>u.username));
}
getUsers();
},[])


return <div>
<h1>Users</h1>
<ul>
{users.map(u=> <li>{u}</li>)}
</ul>

</div>
}

export default Page;
